    template: 'clare',
    namePlaceholder: 'e.g. Zac Efron',
    emailPlaceholder: 'e.g. zac@efron.com',
    submitText: 'Sign up',
}

const Form = () => (
    <body>
        <h1>hi</h1>
        <ConvertKitForm className={styles.ck-fm} {...config} />
    </body>
)

export default Form;
